import { style } from "./BoxesMenuItem.module.scss";

const BoxesMenuItem = () => {
  return (
    <div>
      <div className={style.itemContainer}>
        <div className={style.itemImg}>
          <img src="" alt="" />
        </div>
        <div className={style.itemText}>
          <p>Learn cards</p>
        </div>
      </div>
    </div>
  );
};

export { BoxesMenuItem };
